import React from 'react';

const SignIn=()=>{
    return(<>
          <div>
              <form>
                  <label>Create Your Account </label>
                  <br/>
                  
                  <input type="text" placeholder ="Enter your first name*" /> <input type ="text" placeholder ="Enter your last name" />
              </form>
          </div>
    </>)
}
export default SignIn;
